import Users from "./users.json";

const Card = ({ name, lastName, group, picture, id }) => {
  return (
    <div className="w-40 h-40 flex justify-center items-center flex-col bg-igray-light rounded-2xl space-y-2 shadow-md p-4">
      <img
        className="shadow w-20 h-20 rounded-full"
        src="assets/Charles.jpg"
        alt=""
      />
      <div className="font-semibold font-pixel text-black">
        {Users[0].name + " " + Users[0].lastName}
      </div>
      <div className="font-semibold font-pixel text-black">
        {Users[0].group}
      </div>
    </div>
  );
};

export default Card;
